--active borrowings have to have queue_position = 0
SELECT 0,b.book_copy_id,b.user_id
FROM Borrowing b
WHERE b.return_date IS NULL


--delete borrowings and reservations where 2 copies are borrowed at the same time
DELETE  rq
FROM Reservation_queue rq
WHERE EXISTS (
	SELECT *
	FROM Reservation_queue rq2
	WHERE rq.book_copy_id = rq2.book_copy_id AND rq.user_id != rq2.user_id
)

DELETE b
FROM Borrowing b
WHERE  b.return_date IS NULL AND EXISTS (
	SELECT *
	FROM Borrowing b2
	WHERE b2.return_date IS NULL AND b2.book_copy_id = b.book_copy_id
		AND b.borrowing_id != b2.borrowing_id
)

